import HomePageText from './HomePageText';
import ProfilePhoto from './Profile_Photo.jpg'
import { SplitScreen } from '../UtilComponents/SplitScreen';

const ProfilePhotoComponent = () => {
    return <img src= {ProfilePhoto} alt='ProfilePhoto' width = '30%'/>
}


function HomePage() {
    return (
    <SplitScreen left = {ProfilePhotoComponent} right = {HomePageText} leftWeight = {1} rightWeight = {4}/>)
}

export default HomePage;
